import React, { useState } from 'react';
import './First.css';
import img1 from '../../images/one.jpeg';
import img2 from '../../images/two.png';
export default function First(){

    const [one,Cone]= useState(true);
    const [two,Ctwo]= useState(false);
    const [three,Cthree]= useState(false);


     return(
        <>
        <div className="f" id='f'>
             <div className="f-wrapper">
                <div className="f1" id="1">
                    <img src={img1} alt="" className='f-img' />
                </div>
                <div className="f2" id="2">
                    <img src={img2} alt="" className='f-img2' />
                    <div className="f2-text">
                        <div className="f2-heading">Director's Message</div>
                        <div className="f2-name" style={{fontSize:"30px",color:"wheat"}}>Niyajuddin Ansari</div>
                        <div className="f2-cont">
                            <p>
                            जब भी पढ़ाई करने बैठे ये सोच कर बैठे कि "आखिरी बार पढ़ रहा हू कल मेरा एग्जाम है "
यकिनन इस सोच के साथ की गयी तैयारी एक अलग लेवल की होगी और आप बड़े से बड़ा एग्जाम असानी से पास कर लेंगे ।
                            </p>
                        </div>
                    </div>
                </div>
                <div className="f3" id="3">
                    <img src="" alt="" className='f-img2' />
                    <div className="f2-text">
                        <div className="f2-heading">Principal's Message</div>
                        <div className="f2-name" style={{fontSize:"30px",color:"wheat"}}>Najma Nesha</div>
                        <div className="f2-cont">
                            <p>
                            रिजल्ट पे ध्यान देकर काम करोगे तो काम नहीं बनेगा ,
तो ध्यान अपने उस छोटे छोटे कदम पर दो जो आप रोज उस रिजल्ट को पाने के लिए लेते हो,यही चीज आपकी आपके रिजल्ट तक लेके जायेगी
                            </p>
                        </div>
                    </div>
                </div>
             </div>
             <div className="f-c">
                <div className="c1" onClick={()=>{
                        document.getElementById("1").style.left="0";
                        document.getElementById("2").style.left="100vw";
                        document.getElementById("3").style.left="200vw";

                }}></div>
                <div className="c2" onClick={()=>{
                        document.getElementById("1").style.left="-100vw";
                        document.getElementById("2").style.left="0";
                        document.getElementById("3").style.left="100vw";

                }}></div>
                <div className="c3" onClick={()=>{
                        document.getElementById("1").style.left="-200vw";
                        document.getElementById("2").style.left="-100vw";
                        document.getElementById("3").style.left="0";

                }}></div>
             </div>
            </div>
        </>
     )
}
